import React from 'react'
import './Medme1.css'

const Medem = () => {
    return (
        <div className='ContainerMedme'>
            <div className="MedmeNavBox">
                <p>MODMENI TANLASHINGIZ UCHUN</p>
                <p>4 SABAB</p>
            </div>
            <div className="MedmeSababBox"></div>
        </div>
    )
}

export default Medem;
